import React from 'react';
import '../styles/home.css'
import exercise from '../assests/exercise.jpg';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';
import Signup from './Signup';
const Home = () => {
  return (
    <><AppBar position="static" color="default" elevation={1} className='custom-appbar'>
          <Toolbar sx={{justifyContent:'space-between'}}>
              <Typography variant="h6" sx={{ flexGrow: 1, color: 'black' ,fontSize:'24px',fontWeight:'bold'}}>
                  Fitness Tracker
              </Typography>
              <Link to="/login" style={{ textDecoration: 'none' }}>
                  <Button style={{color:'white',background:'blue',fontWeight:'bold'}} variant="outlined">Login</Button>
              </Link>
          </Toolbar>
      </AppBar>
      <div className="home-container">
              <div className="image-container">
                  <img src={exercise} alt="Exercise" />
              </div>
              <div className="text-container">
                 <Signup/>
              </div>
          </div></>
  );
};

export default Home;
